function drawStatistic(t,e,a){function i(){var i=google.visualization.arrayToDataTable(e),o={title:t,pieHole:.4},c=new google.visualization.PieChart(document.getElementById(a));c.draw(i,o)}google.charts.load("current",{packages:["corechart"]}),google.charts.setOnLoadCallback(i)}$(document).ready(function(){$.ajax({type:"GET",url:"/master/devices-statistics/values",success:function(t){if(t[0].length>0){var e=[["Name","Value"]];for(i=0;i<t[0].length;i++)e.push([t[0][i].device_type,parseInt(t[0][i].count)]);drawStatistic("Devices type statistics",e,"donutchart-device")}if(t[1].length>0){var a=[["Name","Value"]];for(i=0;i<t[1].length;i++)a.push([t[1][i].device_os,parseInt(t[1][i].count)]);drawStatistic("Devices OS statistics",a,"donutchart-os")}}})}),$(window).on("load",function(){});